import './Chart.css'
import ChartBar from './ChartBar'
const Chart = (props) => {

    const Values = props.datapoints.map(datapoint => datapoint.Value);    
    const maxValue = Math.max(...Values);

  return props.datapoints.map(datapoint => <ChartBar key={datapoint.label} label = {datapoint.label} maxValue ={maxValue} value={datapoint.value}/>)
}

export default Chart;
